
<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <style>
    @page {
      size: Letter;
      margin: 0;
    }
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }
    body {
      font-family: 'Georgia', serif;
    }
    .page {
      width: 8.5in;
      height: 11in;
      page-break-after: always;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      background: #fafafa;
      position: relative;
    }
    .page:last-child {
      page-break-after: avoid;
    }
    .cover-page {
      background: linear-gradient(135deg, #f5f7fa 0%, #e8ecf1 100%);
    }
    .cover-page img {
      max-width: 90%;
      max-height: 70%;
      object-fit: contain;
      border-radius: 12px;
      box-shadow: 0 10px 40px rgba(0,0,0,0.15);
    }
    .cover-page h1 {
      margin-top: 30px;
      font-size: 36px;
      color: #2c3e50;
      text-align: center;
    }
    .cover-page .subtitle {
      font-size: 18px;
      color: #7f8c8d;
      margin-top: 10px;
    }
    .cover-page .style-badge {
      position: absolute;
      top: 20px;
      right: 20px;
      background: #3498db;
      color: white;
      padding: 8px 16px;
      border-radius: 20px;
      font-size: 14px;
      font-weight: bold;
    }
    .chapter-page img {
      max-width: 85%;
      max-height: 65%;
      object-fit: contain;
      border-radius: 8px;
      box-shadow: 0 8px 30px rgba(0,0,0,0.12);
    }
    .chapter-page h2 {
      margin-top: 25px;
      font-size: 28px;
      color: #34495e;
    }
    .chapter-page p {
      margin-top: 15px;
      font-size: 16px;
      color: #666;
      max-width: 70%;
      text-align: center;
      line-height: 1.6;
    }
  </style>
</head>
